################################################### Game Loop ##########################################################
.text
.globl main

main:

start_screen:
    # Set up the arguments for display_image
    la $a0, start_screen_start   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    
    check:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress
    	j check
     
     keypress:
     	lw $t2, 4($t9)
     	beq $t2, 0x73, start_screen_exit
     	beq $t2, 0x0A, start_level
     	j check
     	
start_screen_exit:
    # Set up the arguments for display_image
    la $a0, start_screen_quit   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    
    check_quit:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress_quit
    	j check_quit
     
     keypress_quit:
     	lw $t2, 4($t9)
     	beq $t2, 0x77, start_screen
     	beq $t2, 0x0A, exit
     	j check_quit
    
    
start_level:
    # Set up the arguments for display_image
    la $a0, level_one   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    
game_loop:
	jal check_press
	
	
	
	
	
	# Sleep for 40ms
	li $v0, 32
	li $a0, 40
	syscall
	
	j game_loop
	

################################################### Display Functions ##########################################################
# Display function
# a0: pointer to image data
# a1: width of the image
# a2: height of the image
# $t0: x position
# $t1: y position
display_image:
    addi $sp, $sp, -16   # Allocate space for 4 saved registers
    sw $ra, 12($sp)      # Save return address
    sw $a0, 0($sp)       # Save image pointer
    sw $a1, 4($sp)       # Save width
    sw $a2, 8($sp)       # Save height

    li $t2, 0x10008000   # Load the base address of the bitmap
    mul $t3, $t1, 128    # Calculate y_offset = y_position * 512
    add $t3, $t3, $t0    # Calculate total_offset = y_offset + x_position
    mul $t3, $t3, 4	 # starting address = total_offset * 4
    add $t2, $t2, $t3    # Add the total_offset to the base address

    li $t4, 0            # Row counter
    li $t5, 0            # Column counter

    loop_row:
        beq $t4, $a2, exit_display # If all rows are processed, exit
	
    loop_col:
        beq $t5, $a1, next_row  # If all columns are processed, go to the next row
	
        lw $t6, 0($a0)          # Load pixel data from the image
        sw $t6, 0($t2)          # Store pixel data to the screen memory
        
        addi $a0, $a0, 4
        addi $t2, $t2, 4
        
        addi $t5, $t5, 1        # Increment column counter
        j loop_col

    next_row:
        addi $t4, $t4, 1        # Increment row counter
        li $t5, 0               # Reset column counter
        
        add $t3, $t1, $t4
    	mul $t3, $t3, 128    	# Calculate y_offset = y_position * 512
    	add $t3, $t3, $t0    	# Calculate total_offset = y_offset + x_position
    	mul $t3, $t3, 4	     	# starting address = total_offset * 4
    	addi $t2, $t3, 0x10008000
    	
        j loop_row
    
    exit_display:
    	lw $ra, 12($sp)      # Restore return address
    	addi $sp, $sp, 16    # Restore stack pointer
    	jr $ra               # Return from function

################################################ Draw Character Function #######################################################
draw_character:

    addi $sp, $sp, -20   # Allocate space for 4 saved registers
    sw $ra, 16($sp)
    
    # Set up the arguments for display_image
    la $a0, character   # Replace image_start with the label of the image data in memory
    li $a1, CHAR_WIDTH           
    li $a2, CHAR_HEIGHT 
    lw $t0, CharX
    lw $t1, CharY        

    # Call display_image
    jal display_image
    
    lw $ra, 16($sp)      # Restore return address
    addi $sp, $sp, 20    # Restore stack pointer
    jr $ra               # Return from function



erase_character:

    addi $sp, $sp, -24   # Allocate space for 4 saved registers
    sw $ra, 20($sp)
    # Set up the arguments for display_image
    la $a0, character_background   # Replace image_start with the label of the image data in memory
    li $a1, CHAR_WIDTH           
    li $a2, CHAR_HEIGHT 
    lw $t0, CharX
    lw $t1, CharY        

    # Call display_image
    jal display_image

    lw $ra, 20($sp)      # Restore return address
    addi $sp, $sp, 24    # Restore stack pointer
    jr $ra               # Return from function



################################################ Input Functions #######################################################
################ Check for Key Press #################
check_press:
	# Fetch keyboard input
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, keypress_happened
	j end_of_actions

############ Check which Key is Pressed ##############
keypress_happened:
	#jal erase_character
	lw $t2, 4($t9)

	# Check if 'a' is pressed
	li $t3, 0x61 # ASCII code for 'a'
	beq $t2, $t3, respond_to_a

	# Check if 'd' is pressed
	li $t3, 0x64 # ASCII code for 'd'
	beq $t2, $t3, respond_to_d

	# Check if 'space' is pressed
	li $t3, 0x20 # ASCII code for space
	beq $t2, $t3, respond_to_space

	# Check if 'p' is pressed
	li $t3, 0x70 # ASCII code for 'p'
	beq $t2, $t3, respond_to_p

############ Respond to Key Presses ##############
respond_to_a:
    # Actions for 'a' keypress
    jal erase_character # erase character in current position
    la $t0, CharX   # Load the address of CharX into $t0
    lw $t1, 0($t0)  # Load the value stored at CharX into $t1
    addi $t1, $t1, -1 # Increment the value in $t1 by -1
    sw $t1, 0($t0)  # Store the updated value in $t1 back to CharX
    j draw_character
    
    j end_of_actions

respond_to_d:
    # Actions for 'd' keypress
    jal erase_character # erase character in current position
    la $t0, CharX   # Load the address of CharX into $t0
    lw $t1, 0($t0)  # Load the value stored at CharX into $t1
    addi $t1, $t1, 1 # Increment the value in $t1 by 1
    sw $t1, 0($t0)  # Store the updated value in $t1 back to CharX
    j draw_character
    
    j end_of_actions

respond_to_space:
    # Actions for 'space' keypress
    jal erase_character # erase character in current position
    la $t0, CharY   # Load the address of CharX into $t0
    lw $t1, 0($t0)  # Load the value stored at CharX into $t1
    addi $t1, $t1, 1 # Increment the value in $t1 by 1
    sw $t1, 0($t0)  # Store the updated value in $t1 back to CharX
    j draw_character

    # Call display_image
    jal display_image
    
    j end_of_actions

respond_to_p:
    # Actions for 'p' keypress
    j main


############### End of the Check Press #################
end_of_actions:
    jr $ra      # Jumps back to location of function call








################################################### Exit ##########################################################
game_over:
    # Set up the arguments for display_image
    la $a0, game_over_screen   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    # Exit program
    li $v0, 10
    syscall
    
win:
    # Set up the arguments for display_image
    la $a0, win_screen   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    # Exit program
    li $v0, 10
    syscall
    
exit:
    # Draw black screen
    # Set up the arguments for display_image
    la $a0, black_screen   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    # Exit program
    li $v0, 10
    syscall
    
    
    
    










